II  http://joeplaysguitar.com/\n\nPerformed by Joseph Palmer http://josephpalmerguitar.com/\n\nProduced by Olesya Kolos and Thomas Cardwell. Special Thank you to Piera Gregory and Salvatore La Pietra.  \n\nPublished by http://www.productionsdoz.com/en/\n\nPedro and Diablo is a story of mistaken identity.  There are 4 people in this story.  \n\nThe first two are sinners, one short and fat and one tall and skinny: they are drunkards, womanizers, gamblers and they are friends. Early in the evening the two of them go out in to the small town.  They celebrate and sin late into the night. However, even a professional sinner must retire at some point. So they begin to stumble, but the journey is difficult because of the state they are in.They spy a graveyard and, naturally, decide to go take a nap.  They each lean up against a gravestone and quickly pass out.\n\nThe other two people in our story are named Pedro and Diablo (Spanish: devil). Pedro is a thief and Diablo is a thief, but Diablo earned his moniker by being the mastermind of all their adventures. Earlier in the evening they went to a rich mans orchard, stole a bunch of apples and put them in a large sack.  \n\nAfter their escape, they went to the graveyard to divide their booty.  They set down near two gravestones, opposite of the two drunkards.  They spread open the bag and began dividing their booty. \nOne for Pedro! One for Diablo.  (march-like song)\nOne for Pedro! One for Diablo \nOne for Pedro! One for Diablo!\nThey are happy, everything is going wonderful.\n\nThe two drunkards wake up and they hear:\nOne for Pedro! One for Diablo. \nOne for Pedro! One for Diablo.\nThe two sinners believe they are hearing St. Peter and the Devil dividing up the  souls in the graveyard. With every utterance,\nOne for Pedro! One for Diablo. \n They are filled with anxiety over their fate. \n\nThe thieves finish dividing up the apples and lean back to enjoy their loot.  Diablo spies two apples that had rolled behind the bag- one large and bruised, the other slender with a worm crawling from it.  Look, Pedro, he says  theres two moreright next to the gravestones. Which one would you like?  Pedro peers down at the shabby apples,  Oh DiabloIts okay.  You can have them both.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/KdK6KAMIt6g/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCyvr160hlOZju51LPyWQDXN-Cp1w","width":168,"height":94},{"url":"https://i.ytimg.com/vi/KdK6KAMIt6g/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCJAM3UgUjXIlwI_G1Enw66sMDrNg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/KdK6KAMIt6g/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDKxMBXDWYB6tcT84IuD4pD-hh4OA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/KdK6KAMIt6g/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAQuGvWH9d-hhv99Xmtm59MludDww","width":336,"height":188},{"url":"https://i.ytimg.com/vi/KdK6KAMIt6g/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"918","author":"joewplaysguitar","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/KdK6KAMIt6g/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/KdK6KAMIt6g","width":1280,"height":720},"title":{"simpleText":"Pedro y Diablo by Joseph V. Williams II"},"description":{"simpleText":"Pedro and Diablo from Zia: Myth and Folklore of New Mexico by Joseph V. Williams II  http://joeplaysguitar.com/\n\nPerformed by Joseph Palmer http://josephpalmerguitar.com/\n\nProduced by Olesya Kolos and Thomas Cardwell. Special Thank you to Piera Gregory and Salvatore La Pietra.  \n\nPublished by http://www.productionsdoz.com/en/\n\nPedro and Diablo is a story of mistaken identity.  There are 4 people in this story.  \n\nThe first two are sinners, one short and fat and one tall and skinny: they are drunkards, womanizers, gamblers and they are friends. Early in the evening the two of them go out in to the small town.  They celebrate and sin late into the night. However, even a professional sinner must retire at some point. So they begin to stumble, but the journey is difficult because of the state they are in.They spy a graveyard and, naturally, decide to go take a nap.  They each lean up against a gravestone and quickly pass out.\n\nThe other two people in our story are named Pedro and Diablo (Spanish: devil). Pedro is a thief and Diablo is a thief, but Diablo earned his moniker by being the mastermind of all their adventures. Earlier in the evening they went to a rich mans orchard, stole a bunch of apples and put them in a large sack.  \n\nAfter their escape, they went to the graveyard to divide their booty.  They set down near two gravestones, opposite of the two drunkards.  They spread open the bag and began dividing their booty. \nOne for Pedro! One for Diablo.  (march-like song)\nOne for Pedro! One for Diablo \nOne for Pedro! One for Diablo!\nThey are happy, everything is going wonderful.\n\nThe two drunkards wake up and they hear:\nOne for Pedro! One for Diablo. \nOne for Pedro! One for Diablo.\nThe two sinners believe they are hearing St. Peter and the Devil dividing up the  souls in the graveyard. With every utterance,\nOne for Pedro! One for Diablo. \n They are filled with anxiety over their fate. \n\nThe thieves finish dividing up the apples and lean back to enjoy their loot.  Diablo spies two apples that had rolled behind the bag- one large and bruised, the other slender with a worm crawling from it.  Look, Pedro, he says  theres two moreright next to the gravestones. Which one would you like?  Pedro peers down at the shabby apples,  Oh DiabloIts okay.  You can have them both."},"lengthSeconds":"208","ownerProfileUrl":"http:/ and Diablo from Zia: Myth and Folklore of New Mexico by Joseph V. Williams II  http://joeplaysguitar.com/\n\nPerformed by Joseph Palmer http://josephpalmerguitar.com/\n\nProduced by Olesya Kolos and Thomas Cardwell. Special Thank you to Piera Gregory and Salvatore La Pietra.  \n\nPublished by http://www.productionsdoz.com/en/\n\nPedro and Diablo is a story of mistaken identity.  There are 4 people in this story.  \n\nThe first two are sinners, one short and fat and one tall and skinny: they are drunkards, womanizers, gamblers and they are friends. Early in the evening the two of them go out in to the small town.  They celebrate and sin late into the night. However, even a professional sinner must retire at some point. So they begin to stumble, but the journey is difficult because of the state they are in.They spy a graveyard and, naturally, decide to go take a nap.  They each lean up against a gravestone and quickly pass out.\n\nThe other two people in our story are named Pedro and Diablo (Spanish: devil). Pedro is a thief and Diablo is a thief, but Diablo earned his moniker by being the mastermind of all their adventures. Earlier in the evening they went to a rich mans orchard, stole a bunch of apples and put them in a large sack.  \n\nAfter their escape, they went to the graveyard to divide their booty.  They set down near two gravestones, opposite of the two drunkards.  They spread open the bag and began dividing their booty. \nOne for Pedro! One for Diablo.  (march-like song)\nOne for Pedro! One for Diablo \nOne for Pedro! One for Diablo!\nThey are happy, everything is going wonderful.\n\nThe two drunkards wake up and they hear:\nOne for Pedro! One for Diablo. \nOne for Pedro! One for Diablo.\nThe two sinners believe they are hearing St. Peter and the Devil dividing up the  souls in the graveyard. With every utterance,\nOne for Pedro! One for Diablo. \n They are filled with anxiety over their fate. \n\nThe thieves finish dividing up the apples and lean back to enjoy their loot.  Diablo spies two apples that had rolled behind the bag- one large and bruised, the other slender with a worm crawling from it.  Look, Pedro, he says  theres two moreright next to the gravestones. Which one would you like?  Pedro peers down at the shabby apples,  Oh DiabloIts okay.  You can have them both.","commandRuns":[{"startIndex":85,"length":26,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAMiEwjpqaSXhfSPAxV0GmgIHQBZJ85IqO-imIDFrukpygEETidxow==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmk3X0ZrLWJRU3Y5SjBQcUU1V0RFdkxNSEw1QXxBQ3Jtc0ttXzhTb3p4T3NnblNBQkxHVUNkSmt6Rk5GeUxKY2JFNDduNXpuanF1dTdvYnZ4UjljRWJ5WFM4VjA2UVNnZGpZYVAtMjBpSEtQaDNlZk9NZkNidERPV3c3NW1FRENFWjU5Um1Ob25HMDRfSlE1XzM1cw\u0026q=http%3A%2F%2Fjoeplaysguitar.com%2F\u0026v=KdK6KAMIt6g","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmk3X0ZrLWJRU3Y5SjBQcUU1V0RFdkxNSEw1QXxBQ3Jtc0ttXzhTb3p4T3NnblNBQkxHVUNkSmt6Rk5GeUxKY2JFNDduNXpuanF1dTdvYnZ4UjljRWJ5WFM4VjA2UVNnZGpZYVAtMjBpSEtQaDNlZk9NZkNidERPV3c3NW1FRENFWjU5Um1Ob25HMDRfSlE1XzM1cw\u0026q=http%3A%2F%2Fjoeplaysguitar.com%2F\u0026v=KdK6KAMIt6g","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":140,"length":30,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAMiEwjpqaSXhfSPAxV0GmgIHQBZJ85IqO-imIDFrukpygEETidxow==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbG1nb0pWQ3VwaWVqZ1oyc2wwNUx4NVRNUzJNQXxBQ3Jtc0tsTzBGZGR4T1Q5YXlfeTZxbFcwQ0dmTjJQMTFvSlVjVnVxWmlmSUUxaG1NVXpoVjVSTUh0dFJmd05xcUY3cE9Kb0dsZGlfcC1VamhCV2wzeGFRcUMxMTQ4MXEzZUlwU1FxQk5fdXBoRWJDUjZjbGd1TQ\u0026q=http%3A%2F%2Fjosephpalmerguitar.com%2F\u0026v=KdK6KAMIt6g","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect
